         // Terminando com "ID/palavra"
         var regexS = palavra + '+\/[0-9]{1,}';

         var regex = new RegExp(regexS);
         var resultado = regex.exec(url);

         if (!resultado || resultado.length < 1) {
            return 0;
         }

         var array = resultado[0].split('/');
         return array[1];
